--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetTranDausByVongDauGiaiDau`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetTranDausByVongDauGiaiDau (IN _LoaiVongDauId char(36), IN _GiaiDauId char(36))
BEGIN
  SET @vongDauId = (SELECT
      v.Id
    FROM vongdau v
    WHERE v.LoaiVongDauId = _LoaiVongDauId
    AND v.GiaiDauId = _GiaiDauId);
  SELECT
    t.Id,
    t.ThoiGianBD,
    t.DaKetThuc,
    t.DangDienRa,
    t.VongDauId,
    d.Ten AS DoiNha,
    dt.SoBanThang AS SBTDoiNha,
    (SELECT
        d.Ten
      FROM doibong_trandau dt2
        INNER JOIN doibong_giaidau dg2
          ON dt2.DoiBongId = dg2.Id
        INNER JOIN doibong d
          ON dg2.DoiBongId = d.Id
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS DoiKhach,
    (SELECT
        dt2.SoBanThang
      FROM doibong_trandau dt2
        INNER JOIN doibong_giaidau dg2
          ON dt2.DoiBongId = dg2.Id
        INNER JOIN doibong d
          ON dg2.DoiBongId = d.Id
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS SBTDoiKhach
  FROM trandau t
    INNER JOIN doibong_trandau dt
      ON dt.TranDauId = t.Id
      AND dt.IsDoiNha = 1
    INNER JOIN doibong_giaidau dg
      ON dg.Id = dt.DoiBongId
    INNER JOIN doibong d
      ON dg.DoiBongId = d.Id
  WHERE t.VongDauId = @vongDauId
  ORDER BY t.ThoiGianBD DESC;
END
$$

--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetTranDauById`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetTranDauById (IN _TranDauId char(36))
BEGIN
  SELECT
    t.Id,
    t.ThoiGianBD,
    t.DaKetThuc,
    t.DangDienRa,
    d.Ten AS DoiNha,
    dt.SoBanThang AS SBTDoiNha,
    d.Id AS DoiNhaId,
    dt.Id AS DoiNhaTranDauId,
    -- tên đội khách
    (SELECT
        d.Ten
      FROM doibong_trandau dt2
        INNER JOIN doibong_giaidau dg2
          ON dt2.DoiBongId = dg2.Id
        INNER JOIN doibong d
          ON dg2.DoiBongId = d.Id
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS DoiKhach,
    -- Số bàn thắng đội khách
    (SELECT
        dt2.SoBanThang
      FROM doibong_trandau dt2
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS SBTDoiKhach,
    -- Đội khách id
    (SELECT
        d.Id
      FROM doibong_trandau dt2
        INNER JOIN doibong_giaidau dg
          ON dt2.DoiBongId = dg.Id
        INNER JOIN doibong d
          ON dg.DoiBongId = d.Id
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS DoiKhachId,
    -- Đội khách trận đấu id
    (SELECT
        dt2.Id
      FROM doibong_trandau dt2
      WHERE dt2.TranDauId = t.Id
      AND dt2.IsDoiNha = 0) AS DoiKhachTranDauId
  FROM trandau t
    INNER JOIN doibong_trandau dt
      ON dt.TranDauId = t.Id
      AND dt.IsDoiNha = 1
    INNER JOIN doibong_giaidau dg
      ON dt.DoiBongId = dg.Id
    INNER JOIN doibong d
      ON d.Id = dg.DoiBongId
  WHERE t.Id = _TranDauId;
END
$$

--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetBXH`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetBXH (IN _GiaiDauId char(36))
BEGIN
  -- Lấy danh sách trận đấu của giải đấu 
  CREATE TEMPORARY TABLE TranDaus AS (SELECT
      t.Id
    FROM trandau t
    WHERE t.VongDauId IN (SELECT
        v.Id
      FROM vongdau v
      WHERE v.GiaiDauId = _GiaiDauId));
  -- Lấy danh sách đội bóng theo trận đấu
  CREATE TEMPORARY TABLE DoiBongs_TranDaus AS
  SELECT
    *,
    (SELECT
        dt1.SoBanThang
      FROM doibong_trandau dt1
      WHERE dt1.TranDauId = dt.TranDauId
      AND dt1.DoiBongId != dt.DoiBongId) AS SoBanThua
  FROM doibong_trandau dt
  WHERE dt.TranDauId IN (SELECT
      td.Id
    FROM TranDaus td);

  CREATE TEMPORARY TABLE TKDoiBongDiem AS SELECT
    d.Ten,
    SUM(dbtd.Diem) AS Diem,
    SUM(dbtd.SoBanThang) AS BanThang,
    SUM(dbtd.SoBanThua) AS BanThua,
    (SELECT
        COUNT(*)
      FROM DoiBongs_TranDaus dbtd1
      WHERE dbtd1.DoiBongId = dbtd.DoiBongId) AS SoTran
  FROM DoiBongs_TranDaus dbtd
    INNER JOIN doibong_giaidau dg
      ON dg.Id = dbtd.DoiBongId
    INNER JOIN doibong d
      ON d.Id = dg.DoiBongId
  GROUP BY dg.DoiBongId
  ORDER BY Diem DESC, BanThang DESC, BanThua ASC, SoTran ASC;


  SET @stt = 0;
  CREATE TEMPORARY TABLE BXH AS
  SELECT
    @stt := @stt + 1 AS ThuHang,
    b.*
  FROM TKDoiBongDiem b;
  SELECT
    *
  FROM BXH b;

  DROP TEMPORARY TABLE TranDaus;
  DROP TEMPORARY TABLE DoiBongs_TranDaus;
  DROP TEMPORARY TABLE TKDoiBongDiem;
  DROP TEMPORARY TABLE BXH;

END
$$

DELIMITER ;

