--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetTranDausByCauThuGhiBan`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetTranDausByCauThuGhiBan (IN _GiaiDauId char(36), IN _CauThuId char(36))
BEGIN

  SET @doiBongId = (SELECT
      c.DoiBongId
    FROM cauthu c
    WHERE c.Id = _CauThuId);
  -- Lấy danh sách đội bóng trận đấu cầu thủ ghi bàn
  CREATE TEMPORARY TABLE BanThangs_CauThu AS
  SELECT
    cdt.DoiBongTranDauId
  FROM cauthua_doibong_trandau cdt
    INNER JOIN sukien s
      ON cdt.Id = s.CauThuDoiBongTranDauId
      AND s.LoaiSuKienId = '3c46f4ee-62ea-5c8d-986f-b9e6bde19f05'
  WHERE cdt.CauThuId = _CauThuId;
  -- Lấy danh sách đội bóng trận đấu trọng mùa giải cần lấy
  CREATE TEMPORARY TABLE DoiBongs_TranDaus AS
  SELECT
    dt.Id,
    dt.TranDauId,
    dt.DoiBongId
  FROM doibong_trandau dt
    INNER JOIN trandau t
      ON dt.TranDauId = t.Id
  WHERE t.VongDauId IN (SELECT
      v.Id
    FROM vongdau v
    WHERE v.GiaiDauId = _GiaiDauId);

  -- Lấy danh sách trận đấu cầu thủ ghi bàn trong giải đấu
  CREATE TEMPORARY TABLE TranDaus AS
  SELECT DISTINCT
    dbtd.TranDauId
  FROM BanThangs_CauThu btct
    INNER JOIN DoiBongs_TranDaus dbtd
      ON btct.DoiBongTranDauId = dbtd.Id;

  SELECT
    d.Ten AS TenDoiThu,
    dbtd.TranDauId
  FROM DoiBongs_TranDaus dbtd
    INNER JOIN doibong d
      ON d.Id = dbtd.DoiBongId
      AND d.Id != @doiBongId
    INNER JOIN TranDaus td
      ON td.TranDauId = dbtd.TranDauId;


  DROP TEMPORARY TABLE BanThangs_CauThu;
  DROP TEMPORARY TABLE DoiBongs_TranDaus;
  DROP TEMPORARY TABLE TranDaus;
END
$$

--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetTKCauThuBanThangs`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetTKCauThuBanThangs (IN _GiaiDauId char(36))
COMMENT 'Thống kê cầu thủ theo bàn thắng'
BEGIN
  -- Lấy danh sách trận đấu của giải đấu 
  CREATE TEMPORARY TABLE TranDaus AS (SELECT
      t.Id
    FROM trandau t
    WHERE t.VongDauId IN (SELECT
        v.Id
      FROM vongdau v
      WHERE v.GiaiDauId = _GiaiDauId));
  -- Lấy danh sách đội bóng theo trận đấu
  CREATE TEMPORARY TABLE DoiBongs_TranDaus AS
  SELECT
    dt.Id
  FROM doibong_trandau dt
    INNER JOIN trandau t
      ON dt.TranDauId = t.Id
  WHERE t.Id IN (SELECT
      td.Id
    FROM TranDaus td);
  -- Lấy danh sách cầu thủ trận đấu
  CREATE TEMPORARY TABLE CauThus_DoiBongs_TranDaus AS
  SELECT
    cdt.Id,
    cdt.CauThuId,
    cdt.IsDaChinh
  FROM cauthua_doibong_trandau cdt
  WHERE cdt.DoiBongTranDauId IN (SELECT
      dbtd.Id
    FROM DoiBongs_TranDaus dbtd);
  -- Lấy danh sách sự kiện theo cầu thủ của giải
  CREATE TEMPORARY TABLE SuKiens_CauThus AS
  SELECT
    ctdbtd.CauThuId AS Id,
    s.LoaiSuKienId,
    s.ThoiDiem
  FROM sukien s
    INNER JOIN CauThus_DoiBongs_TranDaus ctdbtd
      ON ctdbtd.Id = s.CauThuDoiBongTranDauId
  WHERE s.LoaiSuKienId = '3c46f4ee-62ea-5c8d-986f-b9e6bde19f05'
  OR s.LoaiSuKienId = '35e532fc-2cf8-11ec-be68-f01faf56e08c'
  OR s.LoaiSuKienId = 'ca161537-2dda-11ec-a23b-f01faf56e08c'
  OR s.LoaiSuKienId = '1441f545-28d9-3de2-70ff-f15282ef58c1';

  -- Lấy danh sách sự kiện thay người
  CREATE TEMPORARY TABLE SuKiens_VaoRa AS
  SELECT
    cdt.Id,
    cdt.CauThuId,
    cdt.IsDaChinh,
    s.ThoiDiem,
    s.LoaiSuKienId
  FROM cauthua_doibong_trandau cdt
    LEFT JOIN sukien s
      ON cdt.Id = s.CauThuDoiBongTranDauId
      AND (s.LoaiSuKienId = '1441f545-28d9-3de2-70ff-f15282ef58c1'
      OR s.LoaiSuKienId = 'ca161537-2dda-11ec-a23b-f01faf56e08c');
  -- Tính thời gian thi đấu của một cầu thủ trong một trận đấu
  CREATE TEMPORARY TABLE ThoiGianThiDaus AS
  SELECT
    skvr.*,
    CASE WHEN skvr.IsDaChinh = 1 THEN CASE WHEN skvr.LoaiSuKienId = '1441f545-28d9-3de2-70ff-f15282ef58c1' THEN skvr.ThoiDiem WHEN skvr.LoaiSuKienId IS NULL THEN 90 END WHEN skvr.IsDaChinh = 0 THEN CASE WHEN skvr.LoaiSuKienId IS NULL THEN 0 WHEN skvr.LoaiSuKienId = 'ca161537-2dda-11ec-a23b-f01faf56e08c' THEN 90 - skvr.ThoiDiem END END AS ThoiGian
  FROM SuKiens_VaoRa skvr;

  -- Lấy danh sách đội bóng theo trận đấu
  CREATE TEMPORARY TABLE DoiBongs_TranDaus1 AS
  SELECT
    *,
    (SELECT
        dt1.SoBanThang
      FROM doibong_trandau dt1
      WHERE dt1.TranDauId = dt.TranDauId
      AND dt1.DoiBongId != dt.DoiBongId) AS SoBanThua
  FROM doibong_trandau dt
  WHERE dt.TranDauId IN (SELECT
      td.Id
    FROM TranDaus td);

  CREATE TEMPORARY TABLE TKDoiBongDiem AS SELECT
    d.Id,
    d.Ten,
    SUM(dbtd.Diem) AS Diem,
    SUM(dbtd.SoBanThang) AS BanThang,
    SUM(dbtd.SoBanThua) AS BanThua,
    (SELECT
        COUNT(*)
      FROM DoiBongs_TranDaus1 dbtd1
      WHERE dbtd1.DoiBongId = dbtd.DoiBongId) AS SoTran
  FROM DoiBongs_TranDaus1 dbtd
    INNER JOIN doibong_giaidau dg
      ON dg.Id = dbtd.DoiBongId
    INNER JOIN doibong d
      ON d.Id = dg.DoiBongId
  GROUP BY dg.Id
  ORDER BY Diem DESC, BanThang DESC, BanThua ASC, SoTran ASC;


  SET @stt = 0;
  CREATE TEMPORARY TABLE BXH AS
  SELECT
    @stt := @stt + 1 AS ThuHang,
    b.*
  FROM TKDoiBongDiem b;



  -- Thống kê
  SELECT
    c.Id,
    CONCAT(c.Ten, '-', c.SoAo, '|', d.Ten) AS Ten,
    (SELECT
        COUNT(*)
      FROM SuKiens_CauThus skct1
      WHERE skct1.LoaiSuKienId = '3c46f4ee-62ea-5c8d-986f-b9e6bde19f05'
      AND skct1.Id = skct.Id) AS BanThang,
    (SELECT
        COUNT(*)
      FROM SuKiens_CauThus skct1
      WHERE skct1.LoaiSuKienId = '35e532fc-2cf8-11ec-be68-f01faf56e08c'
      AND skct1.Id = skct.Id) AS KienTao,
    (SELECT
        b.ThuHang
      FROM BXH b
      WHERE b.Id = d.Id) AS ThuHang,
    (SELECT
        SUM(tgtd.ThoiGian)
      FROM ThoiGianThiDaus tgtd
      WHERE tgtd.CauThuId = c.Id) AS ThoiGian
  FROM SuKiens_CauThus skct
    INNER JOIN cauthu c
      ON c.Id = skct.Id
    INNER JOIN doibong d
      ON c.DoiBongId = d.Id
  GROUP BY c.Id
  HAVING BanThang > 0
  ORDER BY BanThang DESC, KienTao DESC, ThuHang ASC, ThoiGian ASC;

  -- Xóa bảng
  DROP TEMPORARY TABLE TranDaus;
  DROP TEMPORARY TABLE DoiBongs_TranDaus;
  DROP TEMPORARY TABLE CauThus_DoiBongs_TranDaus;
  DROP TEMPORARY TABLE SuKiens_CauThus;
  DROP TEMPORARY TABLE SuKiens_VaoRa;
  DROP TEMPORARY TABLE ThoiGianThiDaus;
  DROP TEMPORARY TABLE DoiBongs_TranDaus1;
  DROP TEMPORARY TABLE TKDoiBongDiem;
  DROP TEMPORARY TABLE BXH;
END
$$

--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_GetDienBienByTranDau`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_GetDienBienByTranDau (IN _TranDauId char(36))
BEGIN
  CREATE TEMPORARY TABLE CauThus AS
  SELECT
    cdt.Id,
    cdt.CauThuId
  FROM cauthua_doibong_trandau cdt
    INNER JOIN doibong_trandau dt
      ON cdt.DoiBongTranDauId = dt.Id
    INNER JOIN trandau t
      ON dt.TranDauId = t.Id
  WHERE t.Id = _TranDauId;
  SELECT
    s.Id,
    s.ThoiDiem,
    s.GhiChu,
    s.CauThuDoiBongTranDauId,
    s.LoaiSuKienId,
    l.Ten,
    (SELECT
        ct.CauThuId
      FROM CauThus ct
      WHERE ct.Id = s.CauThuDoiBongTranDauId) AS CauThuId
  FROM sukien s
    INNER JOIN loaisukien l
      ON l.Id = s.LoaiSuKienId
  WHERE s.CauThuDoiBongTranDauId IN (SELECT
      ct.Id
    FROM CauThus ct);
  DROP TEMPORARY TABLE CauThus;
END
$$

--
-- Create procedure `b17dccn490_lkphuc_pttkdbclpm`.`Proc_CheckDangNhap`
--
CREATE OR REPLACE PROCEDURE b17dccn490_lkphuc_pttkdbclpm.Proc_CheckDangNhap (IN _TenDangNhap varchar(255), IN _MatKhau varchar(255))
COMMENT 'Kiểm tra đăng nhập'
BEGIN
  SELECT
    b.Ten,
    b.Id
  FROM bantochuc b
  WHERE b.TenDangNhap = _TenDangNhap
  AND b.MatKhau = _MatKhau;
END
$$

